import Col from 'react-bootstrap/Col';

function Profile() {
    return(
        /* Edit and view user profile information*/
        <div>
            <NavigationBar />
            <div>            
                <h1>Profile</h1>
            </div>
        </div>
    )
}

export default Profile;
